import React,{useState} from 'react';


const Page =(props) => {
    const newDateMaker = props.newDateMaker
    const [text , setText] = useState({
        val1: "",
        val2: "",
    })

    const changeDec = (e) => {
       const {value,name} = e.target
        setText({[name]:value})
    }

    const submit = (event) => {
        event.preventDefault()
        newDateMaker(text)
        setText({
            val1: "",
            val2: "",
        })
    }

    return (
       <form onSubmit={submit}>

           <input type={"text"} name = "val1" value={text.val1} onChange={changeDec}/>
           <input type={"text"} name={"val2"} value={text.val2} onChange={changeDec}/>

<br/>
           <button type={'submit'}>submit</button>


       </form>


    )


}
export default  Page
